(() => { 'use strict'; const e = document.getElementById('spotify-button'); const t = document.getElementById('deezer-button'); e.addEventListener('click', function (t) { t.preventDefault(), chrome.tabs.create({ url: e.href }) }), t.addEventListener('click', function (e) { e.preventDefault(), chrome.tabs.create({ url: t.href }) }), fetch('links.json').then(e => e.json()).then(n => { e.href = n.spotifyLink, t.href = n.deezerLink }).catch(e => console.error(e)) })()
